import React from 'react'

const Card = (countryName, countryContinent) => {
  return (
    <div>
      <h1>{countryName}</h1>
      <h2>{countryContinent}</h2>
      <img src="foto.jpg" alt="not found" />
    </div>
  )
}

export default Card
